import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom";
import NavBar from './Navbar';
import  Home from './Composants/Home'
import About from './Composants/About'


function App() {
  return (

   <BrowserRouter>
      <NavBar />
      <div>
        <Routes>
          <Route path='/' element={<Home/>} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
